'    l_idx_r           pls_integer;',
'    l_width      p_dynamic_action.attribute_01%TYPE := p_dynamic_action.attribute_01;',
'    l_height     p_dynamic_action.attribute_02%TYPE := p_dynamic_action.attribute_02;',
'    l_colorDark  p_dynamic_action.attribute_02%TYPE := p_dynamic_action.attribute_03;',
'    l_colorLight p_dynamic_action.attribute_02%TYPE := p_dynamic_action.attribute_04;',
'    l_sql        p_dynamic_action.attribute_02%TYPE := p_dynamic_action.attribute_05;',
'BEGIN',
'  -- Debug',
'  IF apex_application.g_debug THEN',
'    apex_plugin_util.debug_dynamic_action(p_plugin         => p_plugin,',
'                                          p_dynamic_action => p_dynamic_action);',
'  END IF;',
'  ',
'    apex_javascript.add_library(p_name           => ''qrcode_apex'',',
'                                p_directory      => p_plugin.file_prefix,',
'                                p_version        => NULL,',
'                                p_skip_extension => FALSE);',
'',
'    vr_context := apex_exec.open_query_context(',
'        p_location          => apex_exec.c_location_local_db,',
'        p_sql_query         => l_sql );',
'    l_idx_r := apex_exec.get_column_position(vr_context , ''QR_ID'');',
'    l_idx_d := apex_exec.get_column_position(vr_context , ''QR_TEXT'');',
'    ',
'    apex_json.initialize_clob_output;',
'    apex_json.open_array;',
'    while apex_exec.next_row( vr_context ) loop',
'        apex_json.open_object;',
'        apex_json.write(''QR_ID'',apex_exec.get_varchar2( vr_context, l_idx_r ));',
'        apex_json.write(''QR_TEXT'',apex_exec.get_varchar2( vr_context, l_idx_d ));',
'        apex_json.close_object;',
'    end loop;',
'    apex_json.close_array;',
'    apex_exec.close(vr_context);',
'    VR_JSON := APEX_JSON.GET_CLOB_OUTPUT(P_FREE => TRUE);',
'    ',
'    /* log produced json for debug */',
'    APEX_DEBUG.error(''JSON for qrcode ''||VR_JSON);',
'    ',
'    apex_exec.close( vr_context );    ',
'    ',
'    apex_debug.info(''apex_plugin.get_ajax_identifier = ''||apex_plugin.get_ajax_identifier);',
'                                                   ',
'    VR_RESULT.JAVASCRIPT_FUNCTION   := ''function () {',
'                                          var myData = ''''''||replace(VR_JSON,chr(10),'''')||'''''';',
'                                          console.log(myData);',
'                                          var qrcode =  QRCode2(myData,',
'                                               {''||',
'                                               apex_javascript.add_attribute(''type'',''terminal'')||',
'                                               apex_javascript.add_attribute(''width'',l_width)||',
'                                               apex_javascript.add_attribute(''margin'',1)||',
'                                               ''"color":{''||',
'                                               apex_javascript.add_attribute(''dark'',l_colorDark)||',
'                                               apex_javascript.add_attribute(''light'',l_colorLight,false,false)||',
'                                               ''}},',
'                                               "''||apex_plugin.get_ajax_identifier||''")}'';',
'    ',
'    RETURN VR_RESULT;',
'END;',
'--',
'--',
'-- AJAX function',
'--',
'--',
'FUNCTION F_AJAX(p_dynamic_action IN apex_plugin.t_dynamic_action,',
'                p_plugin         IN apex_plugin.t_plugin)',
'  RETURN apex_plugin.t_dynamic_action_ajax_result IS',
'  -- plugin attributes',
'  l_result           apex_plugin.t_dynamic_action_ajax_result;',
'  l_storage_type     p_dynamic_action.attribute_10%TYPE := p_dynamic_action.attribute_10;',
'  l_table_name       p_dynamic_action.attribute_06%TYPE := p_dynamic_action.attribute_06; ',
'  l_pk_column        p_dynamic_action.attribute_07%TYPE := p_dynamic_action.attribute_07;',
'  l_clob_column      p_dynamic_action.attribute_08%TYPE := p_dynamic_action.attribute_08;',
'  l_date_column      p_dynamic_action.attribute_09%TYPE := p_dynamic_action.attribute_09;',
'  l_qrval_column     p_dynamic_action.attribute_11%TYPE := p_dynamic_action.attribute_11;',
'  l_dml_operation    p_dynamic_action.attribute_12%TYPE := p_dynamic_action.attribute_12;',
'  ',
'  -- other variables',
'  l_type                VARCHAR2(50);',
'  l_blob                BLOB := empty_blob();',
'  l_clob                clob := null;',
'  l_filename            VARCHAR2(200);',
'  l_mime_type           VARCHAR2(100);',
'  l_delete_id           NUMBER;  ',
'  l_values              apex_json.t_values;',
'  --',
'  -- Helper Functions',
'  --',
'  -- Write Error JSON',
'  PROCEDURE write_htp_error(p_message IN VARCHAR2,',
'                            p_id      IN VARCHAR2 := NULL) IS',
'  BEGIN',
'    htp.init;',
'    apex_debug.info(''{ "status": "error", "message": "'' ||',
'          apex_escape.json(p_message) || ''", "code": "'' ||',
'          apex_escape.json(SQLERRM) || ''", "id": "'' ||',
'          apex_escape.json(p_id) || ''" }'');',
'    htp.p(''{ "status": "error", "message": "'' ||',
'          apex_escape.json(p_message) || ''", "code": "'' ||',
'          apex_escape.json(SQLERRM) || ''", "id": "'' ||',
'          apex_escape.json(p_id) || ''" }'');',
'  END write_htp_error;',
'  --',
'  -- Write Success JSON',
'  PROCEDURE write_htp_success(p_message IN VARCHAR2,',
'                              p_id      IN VARCHAR2 := NULL) IS',
'  BEGIN',
'    htp.init;',
'    apex_debug.info(''{ "status": "success", "message": "'' ||',
'          apex_escape.json(p_message) || ''", "code": "", "id": "'' ||',
'          apex_escape.json(p_id) || ''" }'');',
'    htp.p(''{ "status": "success", "message": "'' ||',
'          apex_escape.json(p_message) || ''", "code": "", "id": "'' ||',
'          apex_escape.json(p_id) || ''" }'');',
'  END write_htp_success;',
'  --',
'  -- Sleep/Pause for given seconds',
'  PROCEDURE sleep(p_seconds IN NUMBER) AS',
'    l_now      TIMESTAMP := systimestamp;',
'    l_end_time TIMESTAMP;',
'  BEGIN',
'    l_end_time := l_now + numtodsinterval(p_seconds,',
'                                          ''second'');',
'',
'    WHILE (l_end_time > l_now) LOOP',
'      l_now := systimestamp;',
'    END LOOP;',
'  END sleep;',
'  --',
'  -- Save File to Collection / Table',
'  PROCEDURE save_file(p_storage_type    IN VARCHAR2 := ''COLLECTION'',',
'                      p_dml_operation   IN VARCHAR2 := ''UPDATE'',',
'                      p_table_name      IN VARCHAR2,',
'                      p_pk_column       IN VARCHAR2 := NULL,',
'                      p_pk_value        IN VARCHAR2 := NULL,',
'                      p_qrval_column    IN VARCHAR2 := NULL,',
'                      p_qrval_value     IN VARCHAR2 := NULL,',
'                      p_clob_column     IN VARCHAR2 := NULL,',
'                      p_clob_value      IN OUT NOCOPY CLOB, ',
'                      p_date_column     IN VARCHAR2 := NULL, ',
'                      p_date_value      IN DATE := SYSDATE) IS',
'    --',
'    l_random_file_id NUMBER;',
'    l_insert_sql     VARCHAR2(32767);',
'    l_insert_id      NUMBER;',
'    l_blob_length    NUMBER := 0;',
'    --',
'  BEGIN',
'    --',
'    -- only process if CLOB has data',
'    IF length(p_clob_value) > 0  THEN',
'      -- Save to APEX Collection',
'      IF p_storage_type = ''COLLECTION'' THEN',
'        BEGIN',
'          -- random file id',
'          l_random_file_id := round(dbms_random.value(100000,99999999));        ',
'          -- add collection member',
'          l_insert_id := apex_collection.add_member(p_collection_name => p_table_name,',
'                                                    p_c001            => p_qrval_value,',
'                                                    p_d001            => SYSDATE, -- date created',
'                                                    p_n001            => l_random_file_id, -- random file id',
'                                                    p_clob001         => p_clob_value); -- CLOB file content',
'          -- status return json',
'          write_htp_success(p_message => ''successfully saved to APEX Collection '' ||',
'                                         p_table_name,',
'                            p_id      => l_insert_id);',
'          --',
'        EXCEPTION',
'          WHEN OTHERS THEN',
'            -- status return json',
'            write_htp_error(''NOT saved to APEX Collection '' ||',
'                            p_table_name);',
'            RAISE;',
'        END;',
'        --',
'        -- Save to custom Table',
'      ELSIF p_storage_type = ''TABLE'' THEN',
'        -- Insert if DML operation is INSERT',
'        IF p_dml_operation = ''INSERT'' THEN',
'            BEGIN',
'            -- dynamic insert statement',
'            -- without optional date column',
'            IF p_date_column IS NULL THEN',
'                l_insert_sql := ''INSERT INTO '' ||',
'                                dbms_assert.sql_object_name(p_table_name) || ''( '' ||',
'                                dbms_assert.simple_sql_name(p_pk_column) || '', '' ||',
'                                dbms_assert.simple_sql_name(p_qrval_column) || '', '' ||',
'                                dbms_assert.simple_sql_name(p_clob_column) ||',
'                                '') VALUES (:pk_value,:qr_val,:clob_value) RETURNING '' ||',
'                                dbms_assert.simple_sql_name(p_pk_column) ||',
'                                '' INTO :pk_val'';',
'                -- execute insert',
'                EXECUTE IMMEDIATE l_insert_sql',
'                USING p_pk_value,p_qrval_value,p_clob_value',
'                RETURNING INTO l_insert_id;',
'                -- with optional date column',
'            ELSE',
'                l_insert_sql := ''INSERT INTO '' ||',
'                                dbms_assert.sql_object_name(p_table_name) || ''( '' ||',
'                                dbms_assert.simple_sql_name(p_pk_column) || '', '' ||',
'                                dbms_assert.simple_sql_name(p_qrval_column) || '', '' ||',
'                                dbms_assert.simple_sql_name(p_clob_column) || '', '' ||',
'                                dbms_assert.simple_sql_name(p_date_column) ||',
'                                '') VALUES (:pk_value,:qr_val,:clob_value,:date_value) RETURNING '' ||',
'                                dbms_assert.simple_sql_name(p_pk_column) ||',
'                                '' INTO :pk_val'';',
'                -- execute insert',
'                EXECUTE IMMEDIATE l_insert_sql',
'                USING p_pk_value,p_qrval_value,p_clob_value, p_date_value',
'                RETURNING INTO l_insert_id;',
'            END IF;',
'            -- status return json',
'            write_htp_success(p_message => ''successfully saved to Custom Table '' ||',
'                                            p_table_name,',
'                                p_id      => l_insert_id);',
'            --',
'            EXCEPTION',
'            WHEN OTHERS THEN',
'                -- status return json',
'                write_htp_error(''NOT saved to Custom Table '' ||',
'                                p_table_name);',
'                RAISE;',
'            END;',
'        ELSE -- Update custom table',
'            BEGIN',
'            -- dynamic insert statement',
'            -- without optional date column',
'            IF p_date_column IS NULL THEN',
'                l_insert_sql := ''UPDATE '' ||',
'                                dbms_assert.sql_object_name(p_table_name) || ',
'                                '' set '' ||',
'                                dbms_assert.simple_sql_name(p_qrval_column) ||'' = :qr_value ,''||',
'                                dbms_assert.simple_sql_name(p_clob_column) ||'' = :clob_value ''||',
'                                ''where '' ||',
'                                dbms_assert.simple_sql_name(p_pk_column) ||'' = :pk_value'';',
'                -- execute insert',
'                EXECUTE IMMEDIATE l_insert_sql',
'                USING p_qrval_value,p_clob_value, p_pk_value;',
'                -- with optional date column',
'            ELSE',
'                l_insert_sql := ''UPDATE '' ||',
'                                dbms_assert.sql_object_name(p_table_name) || ',
'                                '' set '' ||',
'                                dbms_assert.simple_sql_name(p_qrval_column) ||'' = :qr_value ,''||',
'                                dbms_assert.simple_sql_name(p_clob_column) ||'' = :clob_value ,''||',
'                                dbms_assert.simple_sql_name(p_date_column) ||'' = :date_value ''||',
'                                ''where '' ||',
'                                dbms_assert.simple_sql_name(p_pk_column) ||'' = :pk_value'';',
'                -- execute insert',
'                EXECUTE IMMEDIATE l_insert_sql',
'                USING p_qrval_value,p_clob_value, p_date_value, p_pk_value;',
'            END IF;',
'            -- status return json',
'            write_htp_success(p_message => ''successfully updated to Custom Table '' ||',
'                                            p_table_name,',
'                                p_id      => l_insert_id);',
'            --',
'            EXCEPTION',
'            WHEN OTHERS THEN',
'                -- status return json',
'                write_htp_error(''NOT updated to Custom Table '' ||',
'                                p_table_name);',
'                RAISE;',
'            END;',
'        END IF;',
'        --',
'      END IF;',
'      -- sleep 0.75 sec',
'      sleep(p_seconds => 75 / 100);',
'      --',
'    END IF;',
'    --',
'  EXCEPTION',
'    WHEN OTHERS THEN',
'      -- sleep 0.75 sec',
'      sleep(p_seconds => 75 / 100);',
'      RAISE;',
'  END save_file;',
'  --',
'BEGIN',
'  -- Debug Info',
'  apex_debug.info(''APEX QRCODE AJAX Parameter x01: '' || apex_application.g_x01);',
'  apex_debug.info(''APEX QRCODE AJAX Parameter x02: '' || apex_application.g_x02);',
'  apex_debug.info(''APEX QRCODE AJAX Parameter x03: '' || apex_application.g_x03);',
'  apex_debug.info(''APEX QRCODE AJAX Parameter x04: '' || apex_application.g_x04);',
'  apex_debug.info(''APEX QRCODE AJAX Parameter x05: '' ||  apex_application.g_x05);',
'  --',
'  -- replace substitution strings',
'  l_storage_type    := apex_plugin_util.replace_substitutions(p_value => l_storage_type);',
'  l_table_name      := apex_plugin_util.replace_substitutions(p_value => l_table_name);',
'  l_pk_column       := apex_plugin_util.replace_substitutions(p_value => l_pk_column);',
'  l_clob_column     := apex_plugin_util.replace_substitutions(p_value => l_clob_column);',
'  l_date_column     := apex_plugin_util.replace_substitutions(p_value => l_date_column);',
'  l_table_name      := upper(l_table_name);',
'  ',
'  -- check if collection exist',
'  IF l_storage_type = ''COLLECTION'' THEN',
'    IF apex_collection.collection_exists(p_collection_name => l_table_name) THEN',
'      apex_collection.delete_collection(l_table_name);',
'    END IF;',
'    apex_collection.create_collection(l_table_name);',
'  END IF;',
'  ',
'  apex_debug.info(''Before loop, storage type =  '' ||l_storage_type);',
'  for i in (',
'  select j.* from',
'      xmltable(''/json/row''',
'               passing  apex_json.to_xmltype(apex_application.g_x01)',
'                             columns',
'                               qr_id   number        path ''QR_ID'',',
'                               qr_text varchar2(255) path ''QR_TEXT'',',
'                               bsvg    clob          path ''B64SVG''',
'                            ) j',
'  ',
'  ) loop',
'    apex_debug.info(''$.QR_ID : '' ||i.qr_text);',
'    BEGIN',
'              save_file(',
'                  p_storage_type    => l_storage_type,',
'                  p_dml_operation   => l_dml_operation,',
'                  p_table_name      => l_table_name,',
'                  p_pk_column       => l_pk_column,',
'                  p_pk_value        => i.qr_id,',
'                  p_qrval_column    => l_qrval_column,',
'                  p_qrval_value     => i.qr_text,',
'                  p_clob_column     => l_clob_column,',
'                  p_clob_value      => i.bsvg,',
'                  p_date_column     => l_date_column,',
'                  p_date_value      => SYSDATE);',
'      EXCEPTION',
'      WHEN OTHERS THEN',
'        RETURN NULL;',
'      END;',
'  end loop;',
'  write_htp_success(''Operation executed successfully'');',
'',
'  RETURN l_result;',
'  --',
'/*EXCEPTION',
'  WHEN OTHERS THEN',
'    -- status return json',
'    write_htp_error(''General Error occured in APEX QRCODE AJAX Function'');',
'    RETURN NULL;*/',
'END F_AJAX;'))
,p_api_version=>2
,p_render_function=>'F_RENDER'
,p_ajax_function=>'F_AJAX'
,p_standard_attributes=>'ONLOAD'
